import React from 'react';
import { Link } from 'react-router-dom';


const BtnIngresar = () => {
  return (

      <div className='containerbtnNuevo'>
            <button className='btnIngresar'><Link to="/login"> Ingresar</Link></button>

    </div>
  );
}

export default BtnIngresar;
